import { Row, Col } from "react-bootstrap";
import styled from "styled-components";
import ReviewCard from "../../components/ReviewCard";
import ProfileBasicInfo from "./ProfileBasicInfo";

const fakeShiller = {
    name: 'Kanye West',
    username: 'iloveducks',
    averagePrice: '10',
    likes: '23',
    averageRating: '4.2',
    bio: 'KANYE2020 ðŸ‡­ðŸ‡°',
    about: `Dogecoin (DOGE) is based on the popular "doge" Internet meme and features a Shiba Inu on its logo. The open-source digital currency was created by Billy Markus from Portland, Oregon and Jackson Palmer from Sydney, Australia, and was forked from Litecoin in December 2013. Dogecoin's creators envisaged it as a fun, light-hearted cryptocurrency that would have greater appeal beyond the core Bitcoin audience, since it was based on a dog meme. Tesla CEO Elon Musk posted several tweets on social media that Dogecoin is his favorite coin.`,
    location: 'Hong Kong',
    website: 'https://KANYEWEST.COM',
    instagram: 'kanyewest',
    twitter: 'kanyewest',
    tiktok: '',
    youtubeLink: 'https://www.youtube.com/channel/UCs6eXM7s8Vl5WcECcRHc2qQ',
    telegramLink: '',
}

function ProfilePage() {
    return (
        <PageWrap>
            <Row>
                <Col md={4}>
                    <ProfileBasicInfo />
                </Col>
                <Col md={8}>
                    <div style={{display: "grid", gap: '64px'}}>
                        <div>
                            <SectionHeader>About</SectionHeader>
                            {fakeShiller.about}
                        </div>

                        <div>
                            <SectionHeader>Completed Collabs</SectionHeader>

                        </div>

                        <div>
                            <SectionHeader>Ongoing Collabs</SectionHeader>

                        </div>

                        <div>
                            <SectionHeader>Reviews as Shiller</SectionHeader>
                            <div style={{display: 'grid', gap: '8px'}}>
                                <ReviewCard />
                                <ReviewCard />
                                <ReviewCard />
                            </div>

                        </div>
                    </div>
                </Col>
            </Row>
        </PageWrap>
    );
}

const PageWrap = styled.div`
    max-width: 1200px;
    margin: auto;
    padding: 60px 20px;
    text-align: start;
`;

const SectionHeader = styled.h3`
    padding-bottom: 16px;
    margin-bottom: 16px;
    border-bottom: 1px solid var(--base-20);
`;

export default ProfilePage;
